    {
        path: '#',
        display: 'About'
    },
    {
        path: '/tours',
        display: 'Tours'
    }
]

const Header = () => {
    return <header className="header">
        <container>
            <Row>
                <div className="nav_wrapper d-flex align-items-center justify-content-between">
                    {     /* ===========logo============*/}
                    <div className="logo">
                        <img src="" alt="" />


                    </div>
                    {     /* ===========logo end=========*/}

                </div>
            </Row>
        </container>
    </header>
};

export default Header;
